int		dfa(char **inp, char **symbol_table, void *lexems)
{
	char		*lex;
	char		*str;
	int			state;
	int			oldstate;
	int			i;

	i = 0;
	state = 1;
	lex = NULL;
	str = *inp;
	while (str[i])
	{
	    oldstate = state;
		state = g_branch_table[(int)(str[i])][state];
		if (!state)
		{
			lex = push_symbol(symbol_table, str, i);
			*inp = &(str[i]);
			push_token(lexems, lex, oldstate);
			return (1);
		}
		i++;
	}
	if (i != 0)
	{
		lex = push_symbol(symbol_table, str, i);
		*inp = &(str[i]);
		push_token(lexems, lex, oldstate);
		return (1);
	}
	return (0);
}

int				build_lexems(char *str, void **lexems, char *symbol_table)
{
	int		ret;

	while ((ret = dfa(&str, &symbol_table, lexems)))
	{
		;
	}
	return (1);
}

t_lexer			*lexer(char const *str, size_t len)
{
	t_lexer		*lexer;
	void		*lexems;
	char		*symbol_table;

	if (!(lexems = vector_create(sizeof(t_lexem))))
		return (lexer_die(NULL, NULL));
	if (!(symbol_table = (char *)malloc(len * 2)))
		return (lexer_die(lexems, NULL));
	if (!(build_lexems((char *)str, &lexems, symbol_table)))
		return (lexer_die(lexems, symbol_table));
	if (!(lexer = (t_lexer *)malloc(sizeof(t_lexer))))
		return (lexer_die(lexems, symbol_table));
	lexer->lexems = lexems;
	lexer->symbol_table = symbol_table;
	return (lexer);
}
